/* jshint node: true */
'use strict';

exports.m = function (parsed, line) {
  var media = {
    def: line[1],
    childlines: [],
    toArray: function () {
      return [['m', media.def]].concat(media.childlines);
    }
  };

  function addChildLine(childLine) {
    media.childlines.push(childLine);
    return addChildLine;
  }

  parsed.push(['m', media]);
  return addChildLine;
};
